import React from 'react';

const Home = () => {
    return (
        <div>
            <img className="ui fluid image" src="/early_morning.jpg" />
            <div className="ui segment">
                <div className="ui two column very relaxed grid">
                    <div className="column">
                        <img className="ui fluid image" src="/kareem.jpeg" />
                        <h3>Kareem Sasa</h3>
                        <p>Web Development, Cyber Security, Software Engineering, Computer Science.</p>
                        <a href="https://www.linkedin.com/in/kareem-sasa-b614401b6/">LinkedIn</a>
                        <br />
                        <a href="https://www.github.com/kareemsasa3">Github</a>
                    </div>
                    <div className="column">

                    </div>
                </div>
                <div className="ui vertical divider"></div>
            </div>
        </div>
    );
};

export default Home;
